INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('458', 'ES', '¿Que muestra la imagen?', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('459', 'ES', 'El email introducido no es valido.', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('460', 'ES', 'Su email para consultas:', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('461', 'ES', 'Por favor, use sólo texto etiquetas de formato HTML - por ejemplo, negrita, color, hipervínculos o links. No introducir tablas, divs, etc', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('462', 'ES', 'La nueva noticia contiene tags HTML', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('463', 'ES', 'Nueva entrada:', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('464', 'ES', 'Tema:', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('465', 'ES', '¿Sabes algunas noticias de interés sobre Geocaching?<br /> Aquí puedes crear una entrada de noticias que se mostrarán en la página principal.', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('466', 'ES', 'La activación de su cuenta se ha realizado correctamente. Ahora puedes entrar en la página de inicio de sesión .<br /><br /> <a href=\"login.php\">Ir a la página de inicio de sesión</a>', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('467', 'ES', 'Ayuda', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('468', 'ES', 'Activar la cuenta', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('469', 'ES', 'Saludos cordiales,<br/>su Equipo de Opencaching', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('470', 'ES', 'Por favor, sea paciente, estamos haciendo todo lo posible para que el sitio este de nuevo en línea tan pronto como sea posible.', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('471', 'ES', 'La cuenta no se pudo crear, la razón no se conoce. Si no puede resolver este problema por sí mismo, por favor contáctenos a través de <a href=\"mailto:%1\">email</a>.', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('472', 'ES', 'Respetamos su privacidad. Sus datos personales serán almacenados en nuestra base de datos pero no divulgación a terceros. Por favor, tome nota detallada de nuestra <a href=\"articles.php?page=dsb\">privacy statement</a>. Si tiene más preguntas, por favor <a href=\"mailto:%1\">contact us</a> <b>before</b> crear una cuenta.', '2010-12-09 00:17:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('473', 'ES', 'Tenemos que aprobar la entrada de noticias antes de que podamos mostrarlo. Vamos a tratar de hacer esto dentro de 24 a 48 horas. La entrada de noticias no se puede modificar después de haberla presentado. Si desea hacer cambios, por favor vuelva a enviar la entrada corregida. Usted puede enviar cualquier noticia sobre Geocaching, pero no podrán presentar publicidad de productos o geocachés. La decisión de aprobar o no aprobar tus noticias son exclusivamente hasta el creador de la página web - no hay demanda para su publicación. En el caso de dudas, por favor esperar si la entrada de noticias serán publicadas, o pedir por correo electrónico a <a href=\"mailto:%1\">%1</a> antes de presentar.', '2010-12-09 00:17:57');
