INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1701', 'ES', '¡Atención! Este geocache es \&quot;<span class=\"errormsg\">%1</span>\&quot;!</strong> No es un contenedor físico a las coordenadas especificadas (o los que tienen que determinar). ¡El interés del lugar no es necesariamente la búsqueda!', '2010-12-09 00:18:01');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1702', 'ES', '¡Atención! Este geocache es \&quot;<span class=\"errormsg\">%1</span>\&quot;!</strong> El geocaché en sí misma o alguns de sus partes que faltan o hay otros problemas que hacen imposible encontrar su ubicación. ¡El interés del lugar no es necesariamente la búsqueda!', '2010-12-09 00:18:01');
